import React from "react";
import {Container, Nav, Navbar} from "react-bootstrap";

const NavbarComp = () => {
    return (
         <div>
            <Navbar>
            <Nav>
                <Container>
                <Nav.Link>Enjiy William Movie</Nav.Link>
                </Container>  
            </Nav>
            </Navbar>

    </div>
          
            );


};


export default NavbarComp;
